import React from "react";
import { AiOutlineSearch } from "react-icons/ai";

export const Searchbar = () => {
  return (
    <>
      <div className="w=1000px">
        <input id="searchbar" type="text" placeholder="cari tipe ras kucing "  className="border-solid border rounded p-2 resize-x w-1000px "/>
        <button className="scale-100">
          <AiOutlineSearch />
        </button>
      </div>
    </>
  );
};

export default Searchbar;
